host: tcs.com:9000
info:
  description: |-
    The TEE Caching Service (TCS) is a component of IntelÂ® Security Libraries (ISecL).
    TCS is responsible for retrieving the collateral for SGX or TDX enabled platforms from Intel PCS server and caching
    them in its database. These Platform Collateral are later used during the Quote Generation and Quote Verification.
    TCS can be deployed in both Cloud Service Provider (CSP) and tenant environments. In the CSP environment, TCS is used
    to fetch PCK certificates for compute nodes in the Data Center. In the tenant environment, it's used to cache platform
    collateral information used in verifying SGX/TDX Quotes.
  license:
    name: 'Copyright (C) 2021 Intel Corporation. SPDX-License-Identifier: BSD-3-Clause'
  title: TEE Caching Service
  version: 4.0.0
