          of the CPU.
        format: string
        in: query
        name: cpusvn
        required: true
        type: string
      - description: Hex-encoded string representation of security version number
          of the PCE currently loaded on the platform.
        format: string
        in: query
        name: pcesvn
        required: true
        type: string
      - description: Hex-encoded string representation of PC enclave identifier.
        format: string
        in: query
        name: pceid
        required: true
        type: string
      - description: Hex-encoded string representation of platform identifier.
