  /sgx/pckcrl:
    get:
      description: |
        Retrieves the Provisioning Certificate Revocation List.
        Returns - The hex-encoded PCK CRL retrieved from PCS server.
      operationId: RetrievePckCrl
      parameters:
      - description: Certification Authority. Supported CAs are "platform" and "processor"
        enum:
        - platform
        - processor
        format: string
        in: query
        name: ca
        required: true
        type: string
      produces:
      - application/pkix-crl
      responses:
        "200":
          description: Successfully retrieved the provisioning certificate revocation
            list.
          headers:
            SGX-PCK-CRL-Issuer-Chain:
              description: Certificate Issuer Chain for PCK CRL
              type: string
          schema:
            example: |
              
            type: string
        "400":
          description: Invalid request body provided
        "500":
          description: Internal server error
      tags:
      - PckCrl
      x-sample-call-endpoint: https://tcs.com:9000/tcs/v4/sgx/pckcrl?ca=platform
      x-sample-call-output: |
        
  /sgx/platforms:
    post:
      description: |
        Retrieves the platform collateral from PCS server and stores the platform data and collateral in DB.
        The serialized PlatformData Go struct object represents the content of the request body.

         | Attribute     | Description |
         |---------------|-------------|
         | cpu_svn       | Hex-encoded string representation of security version number of the CPU. |
         | enc_ppid      | Hex-encoded string representation of Provisioning ID for the processor package or the platform instance. |
         | manifest      | Hex-encoded string representation of manifest. |
         | pce_id        | Hex-encoded string representation of PC enclave identifier. |
         | pce_svn       | Hex-encoded string representation of security version number of the PCE currently loaded on the platform. |
         | qe_id         | Hex-encoded string representation of platform identifier. |
         | hardware_uuid | Host hardware-uuid. |

        Returns - The serialized Response Go struct object which mentions platform info is cached or not.
      operationId: CachePlatformInfo
      parameters:
      - in: body
        name: request body
        required: true
        schema:
          $ref: '#/definitions/PlatformData'
      - description: Content-Type header
        enum:
        - application/json
        in: header
        name: Content-Type
        required: true
        type: string
      - description: Accept header
        enum:
        - application/json
        in: header
        name: Accept
        required: true
        type: string
      produces:
      - application/json
      responses:
        "200":
          description: platform info already cached
        "201":
          description: platform data pushed to TCS
          schema:
            $ref: '#/definitions/Response'
        "400":
          description: Invalid request body provided
        "401":
          description: Un-authorized request
        "415":
          description: Invalid Content-Type Header in Request
        "500":
          description: Internal server error
      security:
      - bearerAuth: []
      tags:
      - PlatformInfo
      x-permissions: platforms:push
      x-sample-call-endpoint: https://tcs.com:9000/tcs/v4/sgx/platforms
      x-sample-call-input: |
        {
          "cpu_svn": "01010000ffff00000000000000000000",
          "enc_ppid": "",
          "manifest": "",
          "pce_id": "0000",
          "pce_svn": "0a00",
          "qe_id": "804b9ba8c1447e99cb16099033386cdd",
          "hardware_uuid": "88888888-8887-0f81-89a3-9819a5a5a5a5"
        }
      x-sample-call-output: |
        {
          "status": "Created",
          "message": "platform data pushed to TCS"
        }
