  /sgx/refreshes:
    get:
      description: |
        Refreshes the platform collateral and stores the updated collateral in DB.
        Supported query params are optional, if provided, only PCK certificates would be refreshed else Non-PCK collateral are refreshed.
        Returns - The serialized Response Go struct object which mentions platform collateral are refreshed or not.
      operationId: RefreshPlatformCollateral
      parameters:
      - description: Type of collateral to be refreshed. Supported type is "certs".
        format: string
        in: query
        name: type
        type: string
      - description: Comma separated fmspc values for which PCK certs needs to be
          refreshed.
        format: string
        in: query
        name: fmspc
        type: string
      - description: Accept header
        enum:
